const createItems = (Beers) =>{
  return (
    Beers.map((item)=><li className='Item'><img src={item.image_url}></img>{item.name}</li>)
  )
}

function Items() {
    const Beers = useSelector((state) => state.Beers.items)
    const Items = createItems(Beers)
    console.log(Beers)
  return (
<ul>
  {Items}
</ul>
  )
}

export default Items
